/*Table structure for table `ahok_sentiment` */

DROP TABLE IF EXISTS `ahok_sentiment`;

CREATE TABLE `ahok_sentiment` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sentiment_id` int(10) unsigned DEFAULT NULL,
  `From_User` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `text` text COLLATE utf8_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ahok_sentiment_id_unique` (`id`),
  KEY `ahok_sentiment_sentiment_id_foreign` (`sentiment_id`),
  CONSTRAINT `ahok_sentiment_sentiment_id_foreign` FOREIGN KEY (`sentiment_id`) REFERENCES `sentimen` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
